import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faTwitter,
  faCodepen,
  faInstagram,
} from "@fortawesome/free-brands-svg-icons";
import resim4 from "../Assets/image1.jpg";
import "./contact.css";

export default function Contact() {
  return (
    <>
      <section className="contact dark:bg-slate-800 flex flex-col justify-center items-center">
        <span className="contact-title dark:text-green">
          Send me a message!
        </span>
        <p className="contact-text dark:text-white">
          Got a question or proposal, or just want <br />
          to say hello? Go ahead.
        </p>
        <span className="contact-mail dark:text-green">
          imunirbesye@gmail.com
        </span>
        <ul className="contact-social-media flex flex-row gap-3 mb-5 dark:text-green">
          <li>
            <FontAwesomeIcon
              icon={faTwitter}
              className="contact-social-media-list-item"
            />
          </li>
          <li>
            <FontAwesomeIcon
              icon={faCodepen}
              className="contact-social-media-list-item"
            />
          </li>
          <li>
            <FontAwesomeIcon
              icon={faInstagram}
              className="contact-social-media-list-item"
            />
          </li>
        </ul>
      </section>
    </>
  );
}
